syntax = "proto3";

package tinder.events.model.app.hubble.details;

option go_package = "github.com/TinderBackend/events.sdk/libraries/model/golang/model/app/hubble/details";
option java_multiple_files = true;
option java_package = "com.tinder.generated.events.model.app.hubble.details";

message DuosRecStatusDetails {
    repeated string other_group_uids = 3;
    repeated int32 profile_element_views_card_users = 8;
    repeated int32 profile_element_count_users = 9;
    repeated int32 media_views_card_users = 10;
    repeated string viewed_profile_elements_users = 11;
    repeated string tappy_element_values_users = 12;
    repeated string value_profile_element_bio_users = 13;
    repeated string value_profile_element_interests_users = 14;
    repeated string value_profile_element_anthem_users = 15;
    repeated string value_profile_element_top_artists_users = 16;
    repeated string value_profile_element_intent_users = 17;
    repeated string value_profile_element_descriptors_users = 18;
    repeated string profile_element_order_users = 19;
    repeated string shared_interests_users = 20;
    
    oneof oneof_other_group_id {
        string other_group_id = 1;
    }
    
    oneof oneof_other_group_size {
        int32 other_group_size = 2;
    }
    
    oneof oneof_s_number {
        int64 s_number = 4;
    }
    
    oneof oneof_category_id {
        string category_id = 5;
    }
    
    oneof oneof_duration_in_millis {
        int64 duration_in_millis = 6;
    }
    
    oneof oneof_method {
        string method = 7;
    }
}
